import React from "react";

function Navbar() {
  return (
    <nav className="navbar navbar-light bg-light px-3">
      <form className="form-inline w-100">
        <input
          className="form-control form-control-lg"
          type="search"
          placeholder="Search books"
          aria-label="Search"
        />
      </form>
    </nav>
  );
}

export default Navbar;
